import { Component } from 'react';
import Header from './conponents/Header/Header.jsx';
import Nav from './conponents/Nav/Nav.jsx';
import Profile from './conponents/Profile/Profile.jsx';
import Dialog from './conponents/Dialogs/Dialog.jsx';
import New from './conponents/New/New.jsx';
import avatarka from './image/down2.jpg';
import Setting from './conponents/Setting/Setting.jsx';
import Music from './conponents/Music/Music.jsx';

import './App.css';
import { Route } from 'react-router-dom';

export default class App extends Component {
  render() {
    return (
      <div className='App'>
        <Header />
        <Nav />
        <Route
          path='/dialog'
          render={() => (
            <Dialog state={this.state.person} messages={this.state.messages} />
          )}
        />
        <Route
          path='/profile'
          render={() => <Profile mymsg={this.props.mymsg} />}
        />
        <Route path='/new' render={() => <New />} />
        <Route path='/setting' render={() => <Setting />} />
        <Route path='/music' render={() => <Music />} />
      </div>
    );
  }
}
